import React, { Component } from "react";
import Card from "./Card";

class CardList extends Component {
  constructor(props) {
    super(props);
    this.state = {
      cardInfo: [
        {
          longNum: "4242424242424242",
          expDate: "06/24",
          cvc: "123",
          last4: "4242",
        },
        {
          longNum: "4242424242424242",
          expDate: "06/24",
          cvc: "123",
          last4: "4242",
        },
      ],
    };
  }
  render() {
    const cards = this.state.cardInfo.map((c) => {
      return (
        <div>
          <Card info={c} />
        </div>
      );
    });

    return (
      <div>
        <h1>CardViewer</h1>
        {cards}
      </div>
    );
  }
}

export default CardList;
